import Cake from "./Cake";

const CakeList = ({ cakes }) => {
    const cakeComponents = cakes.map((cake, id) => {
        return <Cake cake={cake} key={id} />;
    });

    return <div className="container"><ul>{cakeComponents}</ul></div>
}
export default CakeList;
